import React from 'react';
import {Helmet} from 'react-helmet'

class Navbar extends React.Component {
    render() {
        return (

            <div>
                            <Helmet>
                <title>HELLO</title>
            </Helmet>
                <h3>hello</h3>
            </div>
        );
    }
}

export default Navbar;
